sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  try {
    var parser = new sn_impex.GlideExcelParser();
    var attachment = new GlideSysAttachment();
    var attachmentStream = attachment.getContentStream(inputs.attachmentSysId);
    parser.parse(attachmentStream);
    var jsonDataArray = [];

    while (parser.next()) {
      var row = parser.getRow();
      jsonDataArray.push(row);
    }
    outputs.jsondata = JSON.stringify(jsonDataArray);
  } catch (ex) {
    gs.error("Error parsing Excel file: " + ex.message);
    outputs.jsondata = "[]";
  }



})(inputs, outputs);

